	   /**  
     * 实现图像的等比缩放和缩放后的截取  
     * @param inFilePath 要截取文件的路径  
     * @param outFilePath 截取后输出的路径  
     * @param width 要截取宽度  
     * @param hight 要截取的高度  
     * @param proportion  
     * @throws Exception  
     */
	public static void resizeImage(String source, String target, int targetW, int targetH, boolean proportion)
	  {
	    try
	    {
	      File file = new File(source);
	      resizeImage(ImageIO.read(file), target, targetW, targetH, proportion);
	    }
	    catch (IOException e) {
	      e.printStackTrace();
	    }
	  }

	  public static void resizeImage(BufferedImage sourceImg, String target, int targetW, int targetH, boolean proportion)
	  {
	    try
	    {
	      BufferedImage src = resize(sourceImg, targetW, targetH, proportion);
	      saveImage(target, src);
	    }
	    catch (Exception e) {
	      e.printStackTrace();
	    }
	  }

	  private static BufferedImage resize(BufferedImage source, int targetW, int targetH, boolean proportion)
	  {
	    int type = source.getType();
	    BufferedImage target = null;
	    double sx = (double) targetW / source.getWidth();
	    double sy = (double) targetH / source.getHeight();
	    // 这里想实现在targetW，targetH范围内实现等比缩放。如果不需要等比缩放   
        // 则将下面的if else语句注释即可   
	    if (proportion) {
	      if (sx > sy) {
	        sx = sy;
	        targetW = (int)(sx * source.getWidth());
	      }
	      else {
	        sy = sx;
	        targetH = (int)(sy * source.getHeight());
	      }
	    }
	    if (type == BufferedImage.TYPE_CUSTOM) {
	      ColorModel cm = source.getColorModel();
	      WritableRaster raster = cm.createCompatibleWritableRaster(targetW, targetH);
	      boolean alphaPremultiplied = cm.isAlphaPremultiplied();
	      target = new BufferedImage(cm, raster, alphaPremultiplied, null);
	    }
	    else {
	      target = new BufferedImage(targetW, targetH, type);
	    }Graphics2D g = target.createGraphics();
	    g.setRenderingHint(RenderingHints.KEY_RENDERING, RenderingHints.VALUE_RENDER_QUALITY);
	    g.drawRenderedImage(source, AffineTransform.getScaleInstance(sx, sy));
	    g.dispose();
	    return target;
	  }

	  private static void saveImage(String saveToFileStr, BufferedImage srcImage) throws Exception {
	    String imgType = "JPEG";
	    if (saveToFileStr.toLowerCase().endsWith(".png")) {
	      imgType = "PNG";
	    }
	    else if (saveToFileStr.toLowerCase().endsWith(".gif")) {
	      imgType = "GIF";
	    }
	    else if (saveToFileStr.toLowerCase().endsWith(".bmp")) {
	      imgType = "BMP";
	    }
	    File saveFile = new File(saveToFileStr);
	    ImageIO.write(srcImage, imgType, saveFile);
	  }

	  public static void rotate(File src, int angel, String target)
	  {
	    try
	    {
	      rotate(ImageIO.read(src), angel, target);
	    }
	    catch (IOException e) {
	      e.printStackTrace();
	    }
	  }

	  public static void rotate(BufferedImage src, int angel, String target)
	  {
	    int src_width = src.getWidth(null);
	    int src_height = src.getHeight(null);

	    Rectangle rect_des = calcRotatedSize(new Rectangle(new Dimension(src_width, src_height)), angel);

	    BufferedImage res = new BufferedImage(rect_des.width, rect_des.height, 1);
	    Graphics2D g2 = res.createGraphics();

	    g2.translate((rect_des.width - src_width) / 2, (rect_des.height - src_height) / 2);
	    g2.rotate(Math.toRadians(angel), src_width / 2, src_height / 2);

	    g2.drawImage(src, null, null);
	    try {
	      saveImage(target, res);
	    }
	    catch (Exception e) {
	      e.printStackTrace();
	    }
	  }

	  private static Rectangle calcRotatedSize(Rectangle src, int angel)
	  {
	    if (angel >= 90) {
	      if (angel / 90 % 2 == 1) {
	        int temp = src.height;
	        src.height = src.width;
	        src.width = temp;
	      }
	      angel %= 90;
	    }

	    double r = Math.sqrt(src.height * src.height + src.width * src.width) / 2.0D;
	    double len = 2.0D * Math.sin(Math.toRadians(angel) / 2.0D) * r;
	    double angel_alpha = (3.141592653589793D - Math.toRadians(angel)) / 2.0D;
	    double angel_dalta_width = Math.atan(src.height / src.width);
	    double angel_dalta_height = Math.atan(src.width / src.height);

	    int len_dalta_width = (int)(len * Math.cos(3.141592653589793D - angel_alpha - angel_dalta_width));
	    int len_dalta_height = (int)(len * Math.cos(3.141592653589793D - angel_alpha - angel_dalta_height));
	    int des_width = src.width + len_dalta_width * 2;
	    int des_height = src.height + len_dalta_height * 2;
	    return new Rectangle(new Dimension(des_width, des_height));
	  }

	
